INSERT INTO `products` (`id`, `category_id`, `product_code`, `image`, `name`, `description`, `registered_in`, `active`) VALUES(6, 3, '300', 'Paneng-Curry.jpg', 'Panang Curry', 'Pasta de Curry vermelho fresco, sementes de cominho e coentro mo&iacute;das, leite de coco, carne de frango ou porco, folhas de lima kaffir, mangeric&atilde;o, piment&atilde;o vermelho, acucar de palmeira, molho de peixe, manteiga de amendoim e creme de coco.\n<br />---<br />\nDry red curry paste cooked with coconut milk, lime leaves, peanut butter and sweet basil leaves. It can take chicken, pork or beef. ', '2012-03-23 11:33:49', 1);
INSERT INTO `products` (`id`, `category_id`, `product_code`, `image`, `name`, `description`, `registered_in`, `active`) VALUES(16, 2, '200', 'Tom-Yum-Koong.jpg', 'Tom Yum Goong (Original)', 'Tom Yum Goong (Original com Camar&atilde;o Rosa) - Preparado com capim lim&atilde;o, pimenta malagueta, coentro, galanga, folhas de lima kaffir, tomate cereja, cogumelos (palha ou shitake ou ostra), camar&atilde;o rosa, molho de peixe, suco de lim&atilde;o, pasta de chilli e a&ccedil;ucar de palmeira. Esse prato pode ser preparado com frutos do mar. Acompanha arroz de jasmin Tailand&ecirc;s. Essa sopa &uacute;nica concentra os gostos azedo, salgado, picante e doce.\n<br />---<br />\nHot Spicy & Sour soup with prawns - This Thai masterpiece teems with shrimp, mushrooms, tomatoes, lemongrass, galangal and kaffir lime leaves. The hearty soup unifies a host of favorite Thai tastes: sour, salty, spicy and sweet.', '2012-04-10 12:06:00', 1);
INSERT INTO `products` (`id`, `category_id`, `product_code`, `image`, `name`, `description`, `registered_in`, `active`) VALUES(4, 3, '302', 'item_11.jpg', 'Massamun Kae Curry', 'O Rei dos curry, esse prato originario do sul da Tailandia, leva alho, gengibre, raiz de coentro, coxas de frango (pode-se usar coxas de pato), batata branca, oleo vegetal, Pasta de curry fresco, folhas de louro, canela, anis estrelado e sementes de cominho.\n<br />---<br />\nClassic Thai curry originated in the south. Authentic recipe and succulent. Massamun curry paste cooked with coconut milk, potatoes & topped with cashew nuts or peanuts. It can have Chicken, Lamb or Pork. Emphatically the king of curries, and perhaps the king of all foods. Spicy, coconutty, sweet and savory, its combination of flavors has more personality than a Thai election.', '2012-03-13 02:17:44', 1);
