INSERT INTO `products` (`id`, `category_id`, `product_code`, `image`, `name`, `description`, `registered_in`, `active`) VALUES(23, 5, '500', 'Pad-Thai-1.jpg', 'Royal Pad Thai Koong', 'Este &eacute; uma prato cl&aacute;ssico tailand&ecirc;s muito conhecido que leva camar&atilde;o, ovos de galinha, noodle tailand&ecirc;s (talharim de arroz), &oacute;leo vegetal, cebola roxa, tofu em cubinhos, amendoim mo&iacute;do, nabos doces em conserva ou vegetal em conserva equivalente, farinha de camar&atilde;o seco, cebolinha, brotos de feij&atilde;o, molho especial para pad thai, molho de peixe, suco de tamarindo, vinagre de arroz e a&ccedil;ucar de palmeira. O prato &eacute; servido com fatias de lim&atilde;o, polvilhado com amemdoim mo&iacute;do. A parte tambem &eacute; servido chilli mo&iacute;do seco para acompanhar.\n<br />---<br />\nClassic well known stir fried rice noodles with bean sprouts, prawns, spring onions, ground peanuts, chicken eggs, garlic, tofu, sweet turnips, dried shrimp powder, fish sauce, pad thai sauce and tamarind juice. Served with fresh lime & dried chillies.', '2012-04-10 21:42:00', 1);
