INSERT INTO `products` (`id`, `category_id`, `product_code`, `image`, `name`, `description`, `registered_in`, `active`) VALUES(82, 4, '406', 'Ped.Toon.Na.Makam.jpg', 'Ped Toon Nam Ma-Kham', 'Peito de pato cozido no molho de tamarindo, esse prato leva cogumelos shitake, raiz de coentro, alho, anis estrelado, pimenta branca em p&oacute;, canela em rama, &oacute;leo vegetal, molho de tamarindo, a&ccedil;ucar de palmeira, molho de peixe, shoyo light, molho de soja agridoce, mel de abelha, castanha portuguesa ou uva passas.\n<br />---<br />\nStewed duck with tamarind sauce, the dish takes mushrooms, coriander roots, white pepper powder, star anise, cinnamon stick, vegetable oil, tamarind sauce, plam sugar, light soya sauce, dark soya sauce (sweet type), bee honey, chestnuts or raisins.', '2013-06-20 21:42:08', 1);
