INSERT INTO `products` (`id`, `category_id`, `product_code`, `image`, `name`, `description`, `registered_in`, `active`) VALUES(91, 12, '1205', 'Khao-Pad.jpg', 'Khao Pad', 'T&iacute;pico arroz frito tailand&ecirc;s, esse prato leva ovos de galinha, arroz branco, piment&atilde;o (verde, amarelo e vermelho), pimentas picadas (varios tipos), cebola branca, cenoura, camar&atilde;o pequeno, carne de caranguejo ou siri, a&ccedil;ucar cristal org&acirc;nico, molho especial, cebolinha, pepino, lim&atilde;o, tomate e coentro. (Se remover a pimenta &eacute; um &oacute;timo prato para crian&ccedil;as)\n<br />---<br />\nFried Rice, just like American Fried Rice, but with some differences. The dish take a large egg, capsicum (red, green and yellow), peppers (many types), onion, carrot, prawns, crab meat, organic sugar, special sauce, spring onion, cucumber, lemon, tomate slice and fresh coriander. Great for kids without peppers.', '2013-08-30 23:39:55', 1);
