INSERT INTO `products` (`id`, `category_id`, `product_code`, `image`, `name`, `description`, `registered_in`, `active`) VALUES(94, 5, '503', 'Yum-Woon-Sen.jpg', 'Yum Woon Sen', 'Glass Noodles (macarr&atilde;o de feij&atilde;o verde), camar&atilde;o, porco finamente picado, cogumelo shitake, aipo chin&ecirc;s, cebola branca, tomate, cebola roxa, pimenta vermelha (dedo de mo&ccedil;a), molho de peixe, a&ccedil;ucar cristal org&acirc;nico e suco de lim&atilde;o.\n<br />---<br />\nThai Green Bean Noodle, prawns, pork, mushroom, chinese celery, onion, tomato, shallot, pepper (dedo de mo&ccedil;a), fish sauce, organic sugar and lime juice.', '2013-08-31 00:13:33', 1);
INSERT INTO `products` (`id`, `category_id`, `product_code`, `image`, `name`, `description`, `registered_in`, `active`) VALUES(95, 6, '600', 'Pad-Thai-Jay.jpg', 'Phad Thai Jay', 'Este &eacute; uma prato cl&aacute;ssico tailand&ecirc;s muito conhecido que foi adaptado para atender os vegetarianos, o prato leva noodle tailand&ecirc;s (massa de arroz), &oacute;leo vegetal, cebola roxa, tofu em cubinhos, amendoim moido, nabos doces em conserva ou vegetal em conserva equivalente, cebolinha, brotos de feij&atilde;o, molho especial para pad thai, suco de tamarindo, chilli em p&oacute;, vinagre de arroz, a&ccedil;ucar de palmeira e \npolvilhado com castanhas de caju ou amendoim picados. A parte e servido peda&ccedil;os de lim&atilde;o.\n<br />---<br />\nClassic well known stir fried rice noodles with bean sprouts, spring onions, ground peanuts, garlic, tofu, sweet turnips, pad thai sauce and tamarind juice. Served with fresh lime.', '2013-08-31 00:18:12', 1);
INSERT INTO `products` (`id`, `category_id`, `product_code`, `image`, `name`, `description`, `registered_in`, `active`) VALUES(96, 6, '601', 'Tow.Hu.Peaw.Wan.2.jpg', 'Tow Hu Peaw Wan', 'Este prato vegetariano leva tofu, &oacute;leo vegetal, pepino japon&ecirc;s, tomate, piment&atilde;o vermelho, piment&atilde;o amarelo, piment&atilde;o verde, cogumelos shitake, mini milho, cebolinha, cebola branca, gengibre, molho especial azedo & agridoce e rabanetes.\n<br />---<br />\nThe dish takes Sweet and Sour sauce, Tofu, baby corn, cucumber, tomato, mixed red, yellow and green bell peper (capsicum), mushroom shitake, spring onion, white onion, ginger, coriander and radish.', '2013-08-31 00:20:23', 1);
INSERT INTO `products` (`id`, `category_id`, `product_code`, `image`, `name`, `description`, `registered_in`, `active`) VALUES(97, 6, '602', '1377915669te.jpg', 'Yum Woon Sen Jay', 'Este prato vegetariano leva Glass Noodles (macarr&atilde;o de feij&atilde;o verde), alho, piment&atilde;o vermelho, aipo, cebola roxa, cebolinha, cenoura, castanha de caju, frutas passas, a&ccedil;ucar cristal org&acirc;nico, flocos de alho frito, suco de lim&atilde;o, shoyo light, amendoim e coentro.\n<br />---<br />\nVegetarian Vermicelli Noodle Salad with raisins and peanuts, celery, shallot, spring onion, lemon juice, light soya sauce, green salad leaves (lettuce), carrot, cashew nuts, capsicum and garlic.  ', '2013-08-31 00:25:09', 1);
INSERT INTO `products` (`id`, `category_id`, `product_code`, `image`, `name`, `description`, `registered_in`, `active`) VALUES(98, 11, '1100', 'Cha-Manao.jpg', 'Cha Manao', 'Ch&aacute; verde Thai com lim&atilde;o.\n<br />---<br />\nThai Green Tea with lemon.', '2013-08-31 00:36:01', 1);
INSERT INTO `products` (`id`, `category_id`, `product_code`, `image`, `name`, `description`, `registered_in`, `active`) VALUES(99, 4, '411', '1378084285te.jpg', 'Naam Jim Satay Sauce', 'Peanut Sauce accompanied with Satay Kai (espetinhos de frango)', '2013-09-01 22:14:25', 0);
INSERT INTO `products` (`id`, `category_id`, `product_code`, `image`, `name`, `description`, `registered_in`, `active`) VALUES(100, 4, '412', '1378862669ang.jpg', 'Kai Yaang', 'Peito de Frango fatiado, Marianado e Grelhado.\n<br />---<br />\nChicken Breast Sliced, marinade and grilled.', '2013-09-10 22:30:32', 1);
INSERT INTO `products` (`id`, `category_id`, `product_code`, `image`, `name`, `description`, `registered_in`, `active`) VALUES(101, 11, '1102', '1378873302om-Whipping-Cream.jpg', 'Cha Nom', 'Ch&aacute; verde Thai com Lim&atilde;o e Creme de Leite Light.\n<br />---<br />\nThai Green Tea with lemon and Light Milk Cream. ', '2013-09-11 01:27:46', 1);
INSERT INTO `products` (`id`, `category_id`, `product_code`, `image`, `name`, `description`, `registered_in`, `active`) VALUES(102, 6, '603', '1381756337-Fak-Thong_edited-1.jpg', 'Kaeng Fak Thong', 'Prato vegetariano preparado com abobora japonesa, curry vermelho, leite de coco, pimenta (dedo de mo&ccedil;a), a&ccedil;ucar de palmeira e manjeric&atilde;o doce.\n<br />---<br />\nVegetarian dish prepared with Japanese pumpkin, red curry, coconut milk, pepper (lady finger - dedo de mo&ccedil;a), palm sugar and sweet basil.', '2013-10-14 10:15:01', 1);
INSERT INTO `products` (`id`, `category_id`, `product_code`, `image`, `name`, `description`, `registered_in`, `active`) VALUES(103, 12, '1207', 'Black.Rice.jpg', 'Khao Si Dam', 'Arroz integral preto.<br />---<br />Black Rice - Whole Grain.', '2013-11-21 13:29:56', 1);
INSERT INTO `products` (`id`, `category_id`, `product_code`, `image`, `name`, `description`, `registered_in`, `active`) VALUES(104, 15, '1501', 'Nam.Prik.Prao.jpg', 'Pasta de Chili Thai', 'Pasta de Chili Thai, pode ser usada no preparo de pratos como o Tom Yum Kum ou simplesmente usado como acompanhamento para outros pratos de outras culin&aacute;rias. Essa pasta &eacute; agridoce e picante. Cont&eacute;m camar&atilde;o. 300ml', '2013-12-10 14:55:22', 1);
INSERT INTO `products` (`id`, `category_id`, `product_code`, `image`, `name`, `description`, `registered_in`, `active`) VALUES(105, 12, '1208', 'Thai.Jasmine.Rice.4.1.jpg', 'Khao Hom Mali', 'Arroz de Jasmim ou arroz arom&aacute;tico.\n<br>---<br>\nJasmine Rice.', '2013-12-29 20:55:54', 1);
INSERT INTO `products` (`id`, `category_id`, `product_code`, `image`, `name`, `description`, `registered_in`, `active`) VALUES(106, 3, '308', 'Yellow-Curry-Sea-Food-500px.JPG', 'Aram Thale Pad Pong Ka-Ree (Curry Amarelo com Frutos do Mar)', 'Esse prato leva Camar&atilde;o, Caranguejo e Lula ao molho aromatizado de curry amarelo indiano, ovos de galinha, alho, cebolinha, cebola branca, pimenta vermelha, shoyo light, aipo chin&ecirc;s e a&ccedil;ucar cristal org&acirc;nico.\n<br>---<br>\nThe dish takes Shrimp, Crab and Squid with indian yellow curry, chicken eggs, garlic, spring onions, white onions, red pepper, light shoyo, chinese celery and  organic crystal sugar.', '2014-02-23 16:35:24', 1);
