INSERT INTO `products_wine_list` (`id`, `wine_color`, `type`, `description`) VALUES(1, 1, 'Syrah ou Shiraz', '(Sah-ra or Shi-raz) Syrah and shiraz are two names for the same variety. Europe vintners only use the name syrah.\n\nFood pairings: meat (steak, beef, wild game, stews, etc.)\n\nDistricts: syrah excels in California, in Australia, and in France’s Rhone Valley.\n\nTypical taste in varietal wine: aromas and flavors of wild black fruit (such as blackcurrant), with overtones of black pepper spice and roasting meat. The abundance of fruit sensations is often complemented by warm alcohol and gripping tannins.\n\nToffee notes if present come not from the fruit but from the wine having rested in oak barrels.\n\nThe shiraz variety gives hearty, spicy reds. While shiraz is used to produce many average wines it can produce some of the world’s finest, deepest, and darkest reds with intense flavors and excellent longevity. You’ll discover Syrahs of value and elegance by reading my reviews of French wines. ');
INSERT INTO `products_wine_list` (`id`, `wine_color`, `type`, `description`) VALUES(2, 1, 'Merlot', '(Mare-lo) Easy to drink. The softness of Merlot has made it an "introducing" wine for new red-wine drinkers.\n\nFood pairings: any will do.\n\nDistricts: a key player in the Bordeaux blend, merlot is now also grown in Italy, Romania, California, Washington State, Chile, Australia, etc. It is the fourth wine grape variety in terms of coverage worldwide (after sultanine blanche, airen blanc, and grenache noir).\n\nTypical taste in varietal wine: typical scents include blackcherry, plums and herbal flavors. The texture is round but a middle palate gap is common. The Merlot type of wine is less tannic (rough) than Cabernet Sauvignon. ');
INSERT INTO `products_wine_list` (`id`, `wine_color`, `type`, `description`) VALUES(3, 1, 'Cabernet sauvignon', '(Ca-burr-nay so-veen-yaw) Widely accepted as one of the world’s best varieties. Cabernet sauvignon is often blended with cabernet franc and merlot. It usually undergoes oak treatment.\n\nFood pairings: best with simply prepared red meat.\n\nDistricts: cabernet sauvignon is planted wherever red wine grapes grow except in the Northern fringes such as Germany. It is part of the great red Médoc wines of France, and among the finest reds in Australia, California and Chile.\n\nTypical taste in varietal wine: full-bodied, but firm and gripping when young.\n\nWith age, polyphenols polymerize: the grip fades away. The rich currant qualities of the Cabernet Sauvignon wine change to that of pencil box. Bell pepper notes remain.\n\nAnother article deals with the health benefits of polyphenols.\n\nVanilla notes if present come not from the fruit but from the oak treatment. They increase review ratings but may overwhelm the varietal taste. ');
INSERT INTO `products_wine_list` (`id`, `wine_color`, `type`, `description`) VALUES(4, 1, 'Malbec', '(Mal-bek)\n\nFood pairings: all types of meat-based meals, foie gras. Argentine Malbec suits Mexican, Cajun, and Indian dishes, if you insist on having wine with such meals.\n\nDistricts: malbec has its origins in the French Bordeaux region. It is grown as côt in the Loire Valley and auxerrois in Cahors. Malbec has also been recognized as médoc noir or pressac again in France. Malbec is widely grown in Argentina, where it is the most popular red grape variety. It is also available in Chile, in Australia, and in the cooler regions of California.\n\nTypical taste in varietal wine: malbec’s characteristics vary greatly depending on where it is grown and how it is transformed. Generally it produces an easy-drinking style, well colored wine that tastes of plums, berries, and spice.\n\nMalbec is often blended with other varieties such as cabernet franc, cabernet sauvignon, merlot, and petit verdot to make Bordeaux style wines. Malbec and some such blends may present some health benefits. ');
INSERT INTO `products_wine_list` (`id`, `wine_color`, `type`, `description`) VALUES(5, 1, 'Pinot noir', '(Pee-know na-wahr) One of the noblest red wine grapes. Pinot noir is difficult to grow, rarely blended, with no roughness.\n\nFood pairings: excellent with grilled salmon, chicken, lamb and Japanese dishes (notably sushi rolls).\n\nDistricts: makes the great reds of Burgundy (from Bourgogne, France), and good wines from Austria, California, Oregon, and New Zealand.\n\nTypical taste in varietal wine: very unlike Cabernet Sauvignon. The structure is delicate and fresh. The tannins are very soft; this is related to the low level of polyphenols. The aromatics are very fruity (cherry, strawberry, plum), often with notes of tea-leaf, damp earth, or worn leather.\n\nYet pinot noir is very transparent to the place where it is grown. The staggering range of wines produced makes it pointless to define which personality is the best expression of the variety. ');
INSERT INTO `products_wine_list` (`id`, `wine_color`, `type`, `description`) VALUES(6, 1, 'Zinfandel', '(Zin-fan-dell) Perhaps the world’s most versatile wine grape, making everything from blush wine (White Zinfandel), to rich, heavy reds.\n\nFood pairings: very much depends on the freshness/heaviness of the wine; tomato-sauce pasta, pizza, and grilled and barbecued meats.\n\nDistricts: only found in California.\n\nTypical taste in varietal wine: often a zesty flavor with berry and pepper. ');
INSERT INTO `products_wine_list` (`id`, `wine_color`, `type`, `description`) VALUES(7, 2, 'Chardonnay', '(Shar-do-nay) Chardonnay was the most popular white grape through the 1990''s. It can be made sparkling or still.\n\nFood pairings: a good choice for fish (even salmon) and chicken dishes.\n\nDistricts: chardonnay makes the principle white wine of Burgundy (Bourgogne, France), where it originated. Chardonnay is versatile and is grown with success in most viticultural areas under a variety of climatic conditions. Yet it only amounts to 2 percent of the world vine areas. Total chardonnay vines cover more than 160,000 hectares (400,000 acres). The biggest states were in 2005:\n\n    U.S.A.: California: 44,509 ha; Oregon and Washington state: 3,200 ha\n    France: 35,252 ha\n    Australia: 22,528 ha\n    Italy: 11,800 ha\n    Moldavia: 6,000 ha\n    South Africa: 8,000 ha\n    Chili: 7,500 ha\n    Argentina: 5,155 ha \n\nTypical taste of the different types of chardonnay: voluptuous. Chardonnay wines are often wider-bodied (and more velvety) than other types of dry whites, with rich citrus (lemon, grapefruit) flavors. Fermenting in new oak barrels adds a buttery tone (vanilla, toast, coconut, toffee). Tasting a USD 20 Californian Chardonnay should give citrus fruit flavors, hints of melon, vanilla, some toasty character and some creaminess. Burgundy whites can taste very different. ');
INSERT INTO `products_wine_list` (`id`, `wine_color`, `type`, `description`) VALUES(8, 2, 'Sauvignon blanc', '(So-veen-yawn Blah)\n\nFood pairings: a versatile food wine for seafood, poultry, and salads.\n\nDistricts: of French origin, sauvignon blanc is grown in the Bordeaux region where it is blended with semillon. The Loire valley and New Zealand produce some excellent sauvignon blanc varietals. Some Australian Sauvignon Blancs, grown in warmer areas, tends to be flat and lack fruit qualities.\n\nTypical taste in varietal wine: sauvignon blanc normally shows a herbal character suggesting bell pepper or freshly mown grass. The dominating flavors range from sour green fruits of apples, pears and gooseberries through to tropical fruits of melon, mango and blackcurrant. Quality unoaked Sauvignon Blancs will display smokey qualities; they require bright aromas and a strong acid finish and are best grown in cool climates. ');
INSERT INTO `products_wine_list` (`id`, `wine_color`, `type`, `description`) VALUES(9, 2, 'Semillon', '(Say-mee-yaw)\n\nFood pairings: Semillon goes with fish but there are many better matches. Serve dry Semillon with clams, mussels, or pasta salad.\n\nDistricts: sémillon is the major white grape in the Bordeaux region of France. Sémillon is also known as Hunter (River Riesling), boal/bual of Madeira, chevrier, columbier, malaga and blanc doux. Sémillon is also grown in Chile, Argentina, Australia, and California.\n\nTypical taste: the wine varietal features distinct fig-like character. Sémillon is often blended with sauvignon blanc to delimit its strong berry-like flavors.\n\nFrom the Bordeaux region of France come the great Sauternes and Barsac. These wines are produced from overripe sémillon grapes. They are blended with sauvignon blanc to produce a syrupy, full-bodied wine that may be world class. ');
INSERT INTO `products_wine_list` (`id`, `wine_color`, `type`, `description`) VALUES(10, 2, 'Moscato', '(Mos-cato) The moscato variety belongs to the muscat family of grapes - and so do moscatel and muscat ottonel.\n\nFood pairings: Moscato shows best on its own: without food but sweet wines will pair with dessert.\n\nDistricts: moscato grows in most vine-friendly climates, including Italy, the Rhône Valley (where it is called muscat blanc à petits grains) and Austria (where it is called Muskateller).\n\nTypical taste: often sweet and always fruity, with a characteristic grapefruity and musky aroma. Moscato wines are easily recognizable to anyone who has tasted a Muscat table grape. ');
INSERT INTO `products_wine_list` (`id`, `wine_color`, `type`, `description`) VALUES(11, 1, 'Pinot grigio', '(Pee-no gree-zo)\n\nFood pairings: versatile.\n\nDistricts: pinot grigio is planted extensively in the Venezia and Alto Adige regions of Italy. Pinot grigio is also grown in the western coastal regions of the U.S.A. It is called malvoisie in the Loire Valley and pinot gris in the rest of France. In Germany and Austria pinot grigio is known as the Ruländer or Grauer Burgunder. Similar aliases are used in the german settled regions of Australia.\n\nTypical taste: crisp, dry wines with good acid "bite" are typically made in Italy and Germany. Oregon or Alsace Pinot Gris shows aromatic, fruity flavors. Pairing with food is more difficult because Alsatian winemakers leave the grapes on the vine much longer. The perfume in Alsatian Pinot Gris makes it especially well suited for Thai or spicy Chinese cuisine. ');
INSERT INTO `products_wine_list` (`id`, `wine_color`, `type`, `description`) VALUES(12, 1, 'Gewürztraminer', '(Gah-vurtz-tra-meener) A very aromatic variety.\n\nFood pairings: gewürztraminer is ideal for sipping. It can fit Asian food, pork and grilled sausages.\n\nDistricts: gewürztraminer is best known in wines from Alsace, Germany, the U.S. West Coast, and New York.\n\nTypical taste in varietal wine: fruity flavors with aromas of rose petals, peaches, lychees, and allspice. A Gewürztraminer seems generally not as refreshing as other types of dry whites. ');
INSERT INTO `products_wine_list` (`id`, `wine_color`, `type`, `description`) VALUES(13, 2, 'Riesling', '(Rees-ling)\n\nFood pairings: dry versions go well with fish, chicken and pork dishes. The crispiness of a Riesling works very well with tuna and salmon while the acidity level intermingles with the slight smokiness of the eel and cuts through the layers of spicier Japanese foods.\n\nDistricts: the classic German grape of the Rhine and Mosel, riesling grows in all wine regions. Germany''s great Rieslings are usually made slightly sweet, with steely acidity for balance. Riesling from Alsace and the Eastern U.S. is also excellent, though usually made in a different style, equally aromatic but typically drier (not sweet). California Rieslings are much less successful, usually sweet without sufficient acidity for balance.\n\nTypical taste in varietal wine: Riesling wines are much lighter than Chardonnay wines. The aromas generally include fresh apples. The riesling variety expresses itself very differently depending on the district and the winemaking. Rieslings should taste fresh. If they do, then they might also prove tastier and tastier as they age.');
INSERT INTO `products_wine_list` (`id`, `wine_color`, `type`, `description`) VALUES(14, 2, 'Viognier', 'Viognier is an aromatic grape variety known for producing textural white wines with strong stone-fruit flavors. On the nose Viognier wines can be very floral, showing lavender and pollen aromas that are quite honeyed in sweeter examples. Apricots are the variety’s classic flavor association, often with a richness that can be interpreted as ripe peach.\n\nPopular blends include: Southern Rhone Blend White, Syrah – Viognier, Chardonnay – Viognier.\n\nFood matches include:\nEurope: Grilled salmon on dauphinois potatoes (dry); glazed apricot tart (tarte aux abricots) (sweet)\nAsia: Cashew-nut curry; pork dumplings (dry)\nAustralasia/Oceania: Grilled kingfish steaks with roasted sweet potato (kumara) (dry); candied orange cheesecake (sweet)\nAfrica/Middle East: Apricot rice pudding (sweet)');
INSERT INTO `products_wine_list` (`id`, `wine_color`, `type`, `description`) VALUES(15, 1, 'Beaujolais nouveau', 'O Beaujolais mais conhecido é o Beaujolais nouveau, um vinho jovem que fica pronto para o consumo aproximadamente 2 meses após a colheita. A chegada do beaujolais nouveau é celebrada pelos franceses, que recebem o vinho simultaneamente sempre na terceira quinta-feira do mês de novembro. Sua chegada é anunciada com a célebre frase Le Beaujolais Nouveaux est arrivé!!! 7\n\nÉ produzido a partir das uvas gamay, por um processo conhecido como maceração carbônica, onde as uvas fermentam em cubas sem esmagamento. A pele da uva é estourada pela fermentação.8\n\nO Nouveau é um vinho muito frutado, leve e fresco. Deve acompanhar pratos igualmente leves e deve ser bebido a uma temperatura mais baixa que outros tintos: aproximadamente 14ºC. Deve ser consumido até seis meses da fabricação.');
INSERT INTO `products_wine_list` (`id`, `wine_color`, `type`, `description`) VALUES(16, 1, 'Barbera', 'Barbera is a dark-skinned red grape variety found in several Italian wine regions, including its native Piedmont, Emilia-Romagna, Puglia, Campania and even the island regions, Sicily and Sardinia. At the turn of the 21st Century, it was Italy''s third most commonly planted red wine grape, after Sangiovese and Montepulciano. Barbera grapes are used both in blended wines and varietals – the latter are becoming increasingly common as Italy continues its move towards varietal labeling.\n\nFood matches include:\nEurope: Vegetable casserole (teglia multicolore); seared rabbit livers\nAsia: Thai duck noodle soup; barbecue pork siu mei\nAmericas: Crumbed beef Milanesa; turkey chili\nAustralasia/Oceania: Roasted herb-crusted lamb rack.');
INSERT INTO `products_wine_list` (`id`, `wine_color`, `type`, `description`) VALUES(17, 2, 'Torrontes', 'Torrontes is best known as the Argentina''s number-one white wine, but the name is actually given to at least five grape varieties. In Argentina, Torrontes is associated with three of these, which all have Muscat of Alexandria as a parent grape. Argentine Torrontes is marked by its floral aromas, which are distinctive of its membership of the extended Muscat family. Its scents are often described as soapy and lightly spicy, with the smell of white flowers.');
INSERT INTO `recipe` (`id`, `recipe_title`, `ingredients`, `for_marinade`, `for_paste`, `for_sauce`, `for_stirfry`, `for_steam`, `for_wrapping`, `seasoning`, `dressing`, `garnishing`, `accompaniment`, `method`, `recipe_author`, `recipe_contact`) VALUES(1, 'Tom Yum Koong (Sopa picante e c', '<p>5 peda&ccedil;os pequenos - pimenta malagueta esmagadas.1 talo - raiz de coentro (isto &eacute; opcional) ou o talo esmagado para liberar o sabor.<br />4 fatias - galanga (fatias finas)<br />1 talo - erva cidrera, corte angular e esmagado<br />1 folha - lima kaffir (esmague com a propria m&atilde;o antes de adicionar<br />2 peda&ccedil;os - cogumelos de paris (corte em 4) champignon<br />2 unidades - camar&atilde;o rosa (sem casca, sem cabe&ccedil;a, mas mantenha o rabo)<br />250 gramas - caldo de galinha (preparado com o proprio frango ou opcional o caldo pode ser preparado com a cabe&ccedil;a e casca do camar&atilde;o rosa).</p>', '', '', '', '', '', '', '<p>1 1/2 colher de sopa - molho de peixe (fish sauce).1 colher de sopa - suco de lim&atilde;o.<br />1/2 colher de ch&aacute; - pasta de chili (Nam Prik Phaow).<br />1/4 colher de ch&aacute; - a&ccedil;ucar.</p>', '', '<p>Folhas de coentro por cima</p>', '', '<ol>\n<li><span id="result_box" class="short_text" lang="pt"><span class="hps">Em</span> <span class="hps">uma panela</span> <span class="hps">em fogo m&eacute;dio: ferver o caldo de galinha.<br /></span></span></li>\n<li><span class="short_text" lang="pt"><span class="hps">Adicione as fatias de galanga, erva cidrera, coloque as folhas de lima kaffir e o coentro (raiz e talo). Continue fervendo tudo.<br /></span></span></li>\n<li><span class="short_text" lang="pt"><span class="hps">Adicionar o cogumelo, camar&atilde;o rosa, molho de peixe, a&ccedil;ucar e a pasta de pimenta (Nam Prik Phaow) e ferver um pouco mais.<br /></span></span></li>\n<li><span class="short_text" lang="pt"><span class="hps">Desligue a chama, adicione a malagueta e o suco de lim&atilde;o. Remova a raiz do coentro antes de servir (serve apenas para dar mais sabor).</span></span></li>\n<li><span class="short_text" lang="pt"><span class="hps">Enfeito com folhas de coentro por cima do prato.<br /></span></span></li>\n</ol>', 'Chef Kanjana', 'kanjana.costa@gmail.com');
INSERT INTO `recipe` (`id`, `recipe_title`, `ingredients`, `for_marinade`, `for_paste`, `for_sauce`, `for_stirfry`, `for_steam`, `for_wrapping`, `seasoning`, `dressing`, `garnishing`, `accompaniment`, `method`, `recipe_author`, `recipe_contact`) VALUES(2, 'Paneang Nua (Paneang Curry com Beef)', '<p>2 colheres de sopa - &oacute;leo vegetal.<br />1 colher de sopa - pasta de curry paneang.<br />1/2 colher de sopa - sementes de cominho e coentro moidas (de preferencia para moidas na hora).<br />100ml - leite de coco.<br />80 gramas - beef (cortado em pequenos tamanhos)<br />2 folhas - lima kaffir (finamente cortada)<br />10 folhas - mangeric&atilde;o doce.<br />1 peda&ccedil;o - pimenta vermelha (finamente fatiado). </p>', '', '', '', '', '', '', '<p>1 colher de sopa - a&ccedil;ucar.<br />1 colher de sopa -molho de peixe (fish sauce).<br />1 colher de sopa - manteiga de amendoim (as importadas s&atilde;o as melhores - americana).</p>', '', '<p>creme ou leite de coco.<br />piment&atilde;o vemelho (finamente fatiado), coloque por cima.<br />folhas de mageric&atilde;o doce.</p>', '', '<ol>\n<li>Em uma panela (sauce pan) na chama m&eacute;dia: adicione e aque&ccedil;a o &oacute;leo vegetal, coloque a pasta de curry paneang.</li>\n<li>Quando a pasta come&ccedil;ar a desenvolver um aroma, adicione a semente de coentro e cominho moidas, misture bem at&eacute; ficar bem homogenio.</li>\n<li>Abaixe a chama e adicione o leite de coco (aos poucos e mexendo), deixe isso ferver por +- 2 minutos.</li>\n<li>Adicione a carne (beef) e deixe cozinhar bem.</li>\n<li>Adicione o tempero - a&ccedil;ucar, molho de peixe e folhas de lima kaffir, manter fervendo.</li>\n<li>Adicione a mantega de amendoim, mexa bem e lance as folhas de mangeric&atilde;o e a pimenta vermelha fatiada. Mexa bem.</li>\n<li>Transfira o curry para o prato que deseja servir e enfeite com o creme de coco, as fatias (lasquinhas) de piment&atilde;o e as folhas do mangeric&atilde;o doce.</li>\n</ol>', 'Chef Kanjana', 'kanjana.costa@gmail.com');
INSERT INTO `recipe` (`id`, `recipe_title`, `ingredients`, `for_marinade`, `for_paste`, `for_sauce`, `for_stirfry`, `for_steam`, `for_wrapping`, `seasoning`, `dressing`, `garnishing`, `accompaniment`, `method`, `recipe_author`, `recipe_contact`) VALUES(3, 'Plaa Neung Ma-Nao (Badejo cozido no vapor com Chili e molho de lim', '<p>150 gramas - peixe badejo ou qualquer outro peixe branco com consistencia firme.<br />1 talo - erva cidrera (tamanho 2 polegadas a partir da raiz)<br />1 folha - lima kaffir (quebre ou rasgue a folha dependendo do estado dela)<br />3 peda&ccedil;os fatiados - galangal.</p>', '', '<p>3 cabe&ccedil;a de alho.<br />1 raiz de coentro.<br />5 peda&ccedil;os de pimenta malagueta.<br />1/2 peda&ccedil;o pimenta vermelha.<br />2 colheres de sopa de suco de lim&atilde;o.<br />1 1/2 colher de sopa de molho de peixe (fish sauce).<br />1 colher de sopa de a&ccedil;ucar.<br />1/2 colher de sopa de coentro (picado)</p>', '', '', '', '', '', '', '<p>Folhas de coentro por cima.<br />3 ou mais fatias bem finas de lim&atilde;o.</p>', '', '<ol>\n<li>cozinhe o peixe e as ervas no vapor por 8-10 minutos at&eacute; cozinhar bem. Separe a parte.</li>\n<li>No mortar (pil&atilde;o de pedra): Pile o alho, raiz de coentro, a pimenta malagueta e o pimenta vermelha at&eacute; virar pasta. Separe a parte.</li>\n<li>Misture a pasta preparado no pil&atilde;o e os ingrediente do molho juntos e adicione folhas de coentro bem cortadas sobre o peixe.</li>\n<li>Coloque as rodelas de lim&atilde;o e as folhas de coentro sobre o peixe decorando o mesmo.</li>\n</ol>', 'Chef Kanjana', 'kanjana.costa@gmail.com');
INSERT INTO `recipe` (`id`, `recipe_title`, `ingredients`, `for_marinade`, `for_paste`, `for_sauce`, `for_stirfry`, `for_steam`, `for_wrapping`, `seasoning`, `dressing`, `garnishing`, `accompaniment`, `method`, `recipe_author`, `recipe_contact`) VALUES(4, 'Phad Thai (Talharim de arroz frito com camar', '<p>2 camar&otilde;es rosa ou 6 camar&otilde;es 7 barbas.<br />1 ovo de galinha.<br />80 gramas de macarr&atilde;o de arroz seco (para amolecer, deixar de molho em agua fria por 20 minutos).<br />2 colheres de sopa de &oacute;leo vegetal.<br />1 cabe&ccedil;a de alho bem picado.<br />1 peda&ccedil;o de cebola roxa bem picada.<br />1 colher de sopa de cubinhos de tofu.<br />1 colher de sopa de amendoim torrado e moido.<br />1 colher de sopa de nabos de conserva bem picado (Item opcional).<br />1/2 colher de sopa de camar&atilde;o desidratado. (Isso aumenta o sabor do prato).<br />2 talos de cebollinha cortados no tamanho de 1 polegada.<br />1/3 copo ou 40 gramas de broto de feij&atilde;o.</p>\n<p>&nbsp;</p>', '', '', '', '', '', '', '<p>1 colher de sopa de a&ccedil;ucar.<br />1 colher de sopa de molho de peixe (fish sauce).<br />1/2 colher de sopa de vinagre de arroz.<br />1 colher de sopa de molho/suco de tamarindo.<br />1/4 colher de ch&aacute; de chilli em p&oacute;.</p>', '', '<p>Metade de um lim&atilde;o.<br />Folhas de Coentro.</p>', '', '<ol>\n<li>Pique a cebola e o alho e separe de lado.</li>\n<li>Na Wok em fogo baixo: adicione o &oacute;leo e misture a cebola e o alho at&eacute; desenvolver aroma.</li>\n<li>Adicione os camar&otilde;es e mexa gentilmente. Adicione os cubos de tofu e os nabos (opcional) e ent&atilde;o o ovo.</li>\n<li>Adicione o macarr&atilde;o de arroz, mexa at&eacute; o macarr&atilde;o ficar bem mole.</li>\n<li>Adicione o tempero: a&ccedil;ucar, molho de peixe (fish sauce), vinagre e molho de tamrindo. Mexa gentilmente at&eacute; estar bem misturado.</li>\n<li>Adicione o camar&atilde;o desidratado, o amendoim, e o p&oacute; de chili e mexa bem. Em seguida coloque o broto de feij&atilde;o e a cebolinha. Desligue o fogo.</li>\n</ol>\n<p>&nbsp;</p>', 'Chef Kanjana', 'kanjana.costa@gmail.com');
INSERT INTO `recipe` (`id`, `recipe_title`, `ingredients`, `for_marinade`, `for_paste`, `for_sauce`, `for_stirfry`, `for_steam`, `for_wrapping`, `seasoning`, `dressing`, `garnishing`, `accompaniment`, `method`, `recipe_author`, `recipe_contact`) VALUES(5, 'Koong Ob Woon Sen (Macarr', '<p>60 gramas de macarr&atilde;o (noodle) - deixar de molho em &aacute;gua fria por 15 minutos para amolecer.<br />3 camar&otilde;es rosa ou 6 camar&otilde;es 7 barbas.<br />2 talos de cebolinha.<br />1 talo de aipo chin&ecirc;s.<br />2 centimetros de gengibre.<br />40 gramas caldo de galinha. (chicken stock)</p>', '', '<p>2 raizes de coentro.<br />2 cabe&ccedil;as de alho sem pele.<br />1 colher de ch&aacute; de pimenta branca em p&oacute;.</p>', '', '', '', '', '<p>1/2 colher de sopa de &oacute;leo de gergelim.<br />1/2 colher de sopa de molho de ostra.<br />1 colher de ch&aacute; de a&ccedil;ucar cristal branco.<br />1 colher de ch&aacute; molho de soja light.<br />1/2 colher de ch&aacute; de molho de soja escuro.<br />2 colher de sopa de &oacute;leo vegetal.</p>', '', '', '', '<ol>\n<li>No mortar (pil&atilde;o de pedra): pilar o alho e a raiz de coentro, pimenta branca em p&oacute;, fa&ccedil;a uma pasta disso e separe.</li>\n<li>Na panela (sauce pan): Adicione o &oacute;leo vegetal e a pasta que voc&ecirc; acabou de fazer, adicione o caldo de galinha e o macarr&atilde;o e mexa bem. Adicione todo o tempero e os camar&otilde;es, gengibre, mexa gentilmente e no topo adicione o aipo chin&ecirc;s e cebolinha. Cubra com a tampa e cozinhe em fogo baixo-m&eacute;dio por mais ou menos dez minutos.</li>\n</ol>\n<p>&nbsp;</p>', 'Chef Kanjana', 'kanjana.costa@gmail.com');
INSERT INTO `recipe` (`id`, `recipe_title`, `ingredients`, `for_marinade`, `for_paste`, `for_sauce`, `for_stirfry`, `for_steam`, `for_wrapping`, `seasoning`, `dressing`, `garnishing`, `accompaniment`, `method`, `recipe_author`, `recipe_contact`) VALUES(6, 'Peito de Pato Assado', '<p>80 gramas de peito de pato</p>', '', '<p>1 raiz de coentro.<br />3 cabe&ccedil;a de alho.<br />1 colher de ch&aacute; de pimenta branca em p&oacute;.<br />1 peda&ccedil;o de anis estrelado.1 peda&ccedil;o (2centimetros) de canela em rama.</p>', '<p>1 colher de ch&aacute; de molho de soja light.</p>', '', '', '', '', '', '', '', '', 'Chef Kanjana', 'kanjana.costa@gmail.com');
INSERT INTO `recipe` (`id`, `recipe_title`, `ingredients`, `for_marinade`, `for_paste`, `for_sauce`, `for_stirfry`, `for_steam`, `for_wrapping`, `seasoning`, `dressing`, `garnishing`, `accompaniment`, `method`, `recipe_author`, `recipe_contact`) VALUES(7, 'Ped Toon Nam Ma-Kham (pato guisado com molho de tamarindo)', '<p>100 gramas de peito de pato assado (fatiado).<br />3 peda&ccedil;os de cogumelo (chinese perfumed mushrooms) deixar de molho em agua fria at&eacute; amolocer.</p>', '', '<p>1 raiz de coentro.<br />3 cabe&ccedil;a de alho.<br />1 colher de ch&aacute; de pimenta branca em p&oacute;.<br />1 peda&ccedil;o de anis estrelado.1 peda&ccedil;o de (2 centimetro) de canela em rama.<br /><br /></p>', '<p>1 colher de sopa de &oacute;leo vegetal.<br />2 colher de sopa de suco ou molho de tamarindo.<br />1 1/2 colher de sopa de a&ccedil;ucar de palmeira.<br />1/2 colher de sopa de molho de peixe (fish sauce).<br />1/2 colher de sopa de molho de soja light.<br />1 colher de ch&aacute; de molho de soja escuro.<br />1 copo de caldo de galinha (preparado do frango).<br />1 colher de ch&aacute; de m&eacute;l de abelha original.<br />60 gramas de castanha portuguesa. (Caso n&atilde;o tenha, usar algum substituto equivalente, por ex.: uvas (tinto) passas).</p>', '', '', '', '', '', '', '', '<ol>\n<li>No mortar (pil&atilde;o de pedra): pilar o alho, raiz de coentro, pimenta branca em p&oacute;. deixe separado.</li>\n<li>Em uma panela (sauce pan) em chama m&eacute;dia: adicione &oacute;leo vegetal e a pasta feito no pil&atilde;o. Mexa enquanto frita at&eacute; desenvolver um aroma. Adicione o caldo de galinha, molho de peixe (fish sauce), molho de tamarindo, o molho de soja light, molho de soja escuro, a&ccedil;ucar de palmera e o mel. Adicione as fatias de peito de pato assado e as castanhas ou uvas passas.</li>\n<li>Deixar ferver mais ou menos por 20 minutos at&eacute; o molho engrossar. Desligue o fogo. Pode servir com p&atilde;o chin&ecirc;s cozido no vapor.</li>\n</ol>', 'Chef Kanjana', 'kanjana.costa@gmail.com');
INSERT INTO `recipe` (`id`, `recipe_title`, `ingredients`, `for_marinade`, `for_paste`, `for_sauce`, `for_stirfry`, `for_steam`, `for_wrapping`, `seasoning`, `dressing`, `garnishing`, `accompaniment`, `method`, `recipe_author`, `recipe_contact`) VALUES(8, 'Laab Kai (Salada de Carne moida de galinha ou porco, estilo Nordeste Tailandes)', '<p>80 gramas de carne moida de frango ou porco.<br />2 cm. galangal (finamente picado).<br />2 peda&ccedil;os de cebola roxa (finamente fatiada).<br />1 talo de cebolinha picada.<br />6 folhas de hosrtel&atilde; (finamente picadas).<br />1 talo de erva cidrera finamente picado. (pegar com raiz)<br />2 folhas de Thai Saw Coriander (opcional, no brasil &eacute; muito dificil encontrar isso fresco).<br />1 folha de lima kaffir finamente picado.<br />3 colher de sopa de caldo de galinha (chicken stock).</p>', '', '', '', '', '', '', '<p>1 colher de ch&aacute; de a&ccedil;ucar.<br />1/2 colher de ch&aacute; de molho de peixe (fish sauce).<br />1 colher de sopa de suco de lim&atilde;o.<br />1 colher de ch&aacute; de chilli em p&oacute;.<br />1 1/2 colher de sopa de arroz glutinoso em p&oacute;. (voc&ecirc; pode tostar o arroz glutinoso em uma frigideira at&eacute; o arroz tornar marrom claro e aromatico, ent&atilde;o pode pilar ele para obter esse p&oacute;, caso n&atilde;o encontre pronto).</p>', '', '', '<p>Deve servir com Khao Niew (Arroz Tailandes Glutinoso). Obs.: N&atilde;o combina com arroz normal tipo I ou tipo II.</p>', '<ol>\n<li>Em uma panela (sauce pan) em fogo m&eacute;dio: Adicione caldo de galinha, a carne de frango ou porco mo&iacute;do e galanga. Quando a carne estiver cozida remova do fogo.</li>\n<li>Adicione o tempero a gosto - molho de peixe (fish sauce), a&ccedil;ucar, suco de lim&atilde;o, o p&oacute; do arroz glutinoso, e o chili em p&oacute;.</li>\n<li>Adicione a erva cidrera picada, a folha de lima kaffir, a cebola fatiada.</li>\n<li>Adicione a cebolinha picada, Thai Saw Coriander (caso houver) e as folhas de hortel&atilde;.</li>\n</ol>', 'Chef Kanjana', 'kanjana.costa@gmail.com');
INSERT INTO `recipe` (`id`, `recipe_title`, `ingredients`, `for_marinade`, `for_paste`, `for_sauce`, `for_stirfry`, `for_steam`, `for_wrapping`, `seasoning`, `dressing`, `garnishing`, `accompaniment`, `method`, `recipe_author`, `recipe_contact`) VALUES(9, 'Khao Niew (Arroz Glutinoso)', '<p>200 gramas de arroz glutinoso (Khao Niew)</p>', '', '', '', '', '', '', '', '', '', '', '<p>Lave o arroz glutinoso e deixe de molho por cerca de tr&ecirc;s horas. Ent&atilde;o envolva todo o arroz em um pano de algod&atilde;o cru e cozinhe isso no vapor por cerca de 30 minutos. Vale lembrar que existem varias t&eacute;cnicas para preparar o arroz glutinoso e essa t&eacute;cnica &eacute; apenas uma delas, que se adapta melhor ao modelo de utensilios que temos no Brasil. Pode-se usar a palha para cozinhar o arroz no vapor, mas &eacute; muito dif&iacute;cil encontrar esse tipo de utensilio.</p>\n<p>Dica: O arroz pode ficar de molho no m&aacute;ximo 30 minutos em &aacute;gua quente. Isso ajuda amolecer bem o arroz.</p>', 'Chef Kanjana', 'kanjana.costa@gmail.com');
INSERT INTO `recipe` (`id`, `recipe_title`, `ingredients`, `for_marinade`, `for_paste`, `for_sauce`, `for_stirfry`, `for_steam`, `for_wrapping`, `seasoning`, `dressing`, `garnishing`, `accompaniment`, `method`, `recipe_author`, `recipe_contact`) VALUES(10, 'Mah-Auan (carne de frango e caranguejo picada e preparado no vapor)', '<p>60 gramas de carne de fango moida.<br />20 gramas de carne de caranguejo picada.1 ovo de galinha.</p>', '', '<p>1 raiz de coentro.<br />2 cabe&ccedil;as de alho (sem casca).<br />1/4 colher de ch&aacute; de pimenta branca em p&oacute;.</p>', '', '', '', '', '<p>1/2 colher de sopa de molho de soja light.<br />1 colher de ch&aacute; de a&ccedil;ucar cristal organico. (pode ser o cristal branco normal, mas n&atilde;o use o refinado aqui).</p>', '', '', '', '<ul>\n<li>No pil&atilde;o de pedra: pilar a pimenta branca em p&oacute;, a raiz do coentro e o alho at&eacute; virar pasta. Separe.</li>\n<li>Em uma tigela: adicione a pasta que acabou de fazer, ovos, a carne picada de frango e caranguejo. Misture tudo muito bem at&eacute; ficar homog&ecirc;nio.</li>\n<li>Coloque a mistura em pequenas forminhas (voc&ecirc; pode usar qualquer formato, pode ser forminhas de ceramica ou copinhos). Coloque para cozinhar no vapor(steamer) at&eacute; ficar bem cozido.</li>\n<li>Remova das forminhas e sirva com algum molho especial (dipping sauce).</li>\n</ul>', 'Chef Kanjana', 'kanjana.costa@gmail.com');
INSERT INTO `recipe` (`id`, `recipe_title`, `ingredients`, `for_marinade`, `for_paste`, `for_sauce`, `for_stirfry`, `for_steam`, `for_wrapping`, `seasoning`, `dressing`, `garnishing`, `accompaniment`, `method`, `recipe_author`, `recipe_contact`) VALUES(11, 'Kaeng Keaw Waan Kai (Curry verde com frango)', '<p>2 colheres de sopa de &oacute;leo vegetal.<br />2 colheres de sopa de pasta de curry verde.<br />1/4 colher de ch&aacute; de semente de coominho pilada na hora.<br />1/4 colher de ch&aacute; de semente de coentro pilada na hora.<br />250 ml de leite de coco.<br />80 gramas de peito de frango (corte em pequenos cubinhos).<br />2 peda&ccedil;os de beringela tailandesa - thai albergines (&Eacute; muito dificil de encontrar essa beringela aqui no brasil, ent&atilde;o a dica seria usar o mini-milho ou ainda o gil&oacute; nordestino).<br />10 beringelas pequenas - pea albergines (tamb&eacute;m muito dif&iacute;cil de encontrar, na aus&ecirc;ncia n&atilde;o use nada para substituir esse ingrediente pois ele n&atilde;o &eacute; usado para dar sabor ao prato).<br /> 1 peda&ccedil;o de piment&atilde;o vermelho (fatias finas).<br />1 folha de lima kaffir (corte em peda&ccedil;o pequenos).<br />10 folhas de mangeric&atilde;o doce.</p>', '', '', '', '', '', '', '<p>1/2 colher de sopa de a&ccedil;ucar de palmera.<br />1/2 colher de sopa de molho de peixe (fish sauce).</p>', '', '<p>piment&atilde;o vermelho fatiado para enfeitar o prato, coloque por cima.</p>', '', '<ol>\n<li>Em uma panela (sauce pan) no fogo m&eacute;dio: adicione o &oacute;leo vegetal. Adicione a pasta de curry verde, as sementes de coentro e cominho piladas, mexa bem fritando tudo at&eacute; desenvolver aroma.</li>\n<li>Adicione um scoop de leite de coco. Deixe ferver at&eacute; o &oacute;leo extrair do leite de coco, fa&ccedil;a o mesmo para o segundo scoop. Ferver por mais alguns poucos minutos.</li>\n<li>Adicione o frango em cubinhos e o resto do leite de coco. Deixe ferver ent&atilde;o adicione a beringela ou mini-milho ou gil&oacute;. Cozinhe o vegetal.</li>\n<li>Adicione o tempero: a&ccedil;ucar de palmera, molho de peixe (fish sauce).</li>\n<li>Adicione folha de lima kaffir, chillis e as folhas de mangeric&atilde;o, mexa gentilmente. Desligue o fogo e transfira para um tigela para servir.</li>\n<li>Coloque as fatias de piment&atilde;o vermelho por cima.</li>\n<li>Pode ser servidor com Arroz Branco, arroz aom&aacute;tico (jasmin rice) ou Roti ou algum outro p&atilde;o achatado que n&atilde;o leve levedura no preparo.</li>\n</ol>', 'Chef Kanjana', 'kanjana.costa@gmail.com');
INSERT INTO `recipe` (`id`, `recipe_title`, `ingredients`, `for_marinade`, `for_paste`, `for_sauce`, `for_stirfry`, `for_steam`, `for_wrapping`, `seasoning`, `dressing`, `garnishing`, `accompaniment`, `method`, `recipe_author`, `recipe_contact`) VALUES(12, 'Satay (Filel mingnon ou frango satay)', '<p>80 gramas de <span id="result_box" class="short_text" lang="pt"><span class="hps">fil&eacute; mignon, corte em 4 fatias fina, cada fatia &eacute; em torno de 2.5 mm de largura e 5 cm de comprimento.<br />4 espetinho de bamboo.<br /></span></span></p>', '<p>2 cabe&ccedil;as de alho sem casca.<br />2 raizes de coentro.<br />1/4 de folha de pandanus fatiada bem fino (Pandan no Brasil n&atilde;o tem, voc&ecirc; pode usar a ess&ecirc;ncia de Pandan).<br />1 colher de ch&aacute; de curry amarelo em p&oacute;.<br />1/2 colher de ch&aacute; de curcuma ou a&ccedil;afr&atilde;o-da-terra em p&oacute;.<br />4 colher de ch&aacute; de leite de coco.<br />1/4 colher de ch&aacute; de pimenta branca em p&oacute;.<br />1/4 de sementes de coentro e cominho bem piladas no pil&atilde;o de pedra.<br />1 colher de ch&aacute; de a&ccedil;ucar branco.<br />1/4 de colher de ch&aacute; de sal.<br />2 colher de ch&aacute; de molho de soja light.<br />1 colher de ch&aacute; de &oacute;leo vegetal.</p>', '', '', '', '', '', '', '', '', '', '<ol>\n<li>Para preparar o molho Pilar o alho e a raiz de coentro at&eacute; virar pasta.</li>\n<li>Minuciosamente misture a pasta com o resto dos ingredientes para preparar o molho (marinade) em uma tigela.</li>\n<li>Adicione a carne no molho e tenha certeza de que a carne vai estar completamente misturada a esse molho. Cobrir e deixar de molho por 1 ou 2 horas (quanto mais melhor) no refrigerador.</li>\n<li>Remover a carne do molho e espetar com os espetinhos. (espete em zigzag).</li>\n<li>Agora precisa grelhar a carne por alguns minutos (+-5 minutos) para cada lado, pode ir virando e adicionando o molho e grelhando at&eacute; estar bem grelhado.</li>\n<li>Servir com "Naam Jim Satay" (molho de amendoim) e "Naam A-jard" (salada de pepino agridoce e azedo).</li>\n</ol>', 'Chef Kanjana', 'kanjana.costa@gmail.com');
INSERT INTO `recipe` (`id`, `recipe_title`, `ingredients`, `for_marinade`, `for_paste`, `for_sauce`, `for_stirfry`, `for_steam`, `for_wrapping`, `seasoning`, `dressing`, `garnishing`, `accompaniment`, `method`, `recipe_author`, `recipe_contact`) VALUES(13, 'Naam A-Jard (Molho de pepino agridoce e citrico para Satay)', '<p>1 folha de pandanus ou ess&ecirc;ncia.<br />2 fatias de galanga (fatiada ou esmagada).<br />40 ml de &aacute;gua.<br />60 gramas vinagre branco de alcool ou vinagre de arroz.<br />80 gramas de a&ccedil;ucar cristal branco.<br />2 colher de sopa de sal.<br />1 peda&ccedil;o de pepino (fatiado ou em cubinhos).<br />2 peda&ccedil;os cebola roxa (finamente picado).<br />1 peda&ccedil;o de piment&atilde;o amarelo (finamente fatiado).</p>', '', '', '', '', '', '', '', '', '<p>Folhas de Coentro</p>', '', '<ol>\n<li>Em uma panela (sauce pan) em fogo m&eacute;dio: Adicione &aacute;gua, a&ccedil;ucar, vinagre, sal e mexa bem para dissolver. Adicione a folha de pandanus ou ess&ecirc;ncia e galanga esmagado. Ferver por 8-10 minutos. Remover do calor e deixar esfriar.</li>\n<li>Coloque todos os vegetais preparados em uma tigela.</li>\n<li>Adicione o molho sobre os vegetais, misture.</li>\n</ol>', 'Chef Kanjana', 'kanjana.costa@gmail.com');
INSERT INTO `recipe` (`id`, `recipe_title`, `ingredients`, `for_marinade`, `for_paste`, `for_sauce`, `for_stirfry`, `for_steam`, `for_wrapping`, `seasoning`, `dressing`, `garnishing`, `accompaniment`, `method`, `recipe_author`, `recipe_contact`) VALUES(14, 'Naam Jim Satay (Molho de amendoim para acompanhar Satay)', '<p>1 cabe&ccedil;a de alho sem casca.<br />2 raizes de coentro.<br />1 1/2 colher de sopa de &oacute;leo vegetal.<br />1 colher de sopa de pasta de curry massaman.<br />1/2 colher de ch&aacute; de pasta de curry vermelho.<br />3/4 de copo de leite de coco.<br />2 colheres de sopa de amendoim torrado e moido.<br />1/2 colher de sopa de gergelim torrado.</p>', '', '', '', '', '', '', '<p>2 colheres de sopa de a&ccedil;ucar de palmera.<br />1 colher de sopa de suco de tamarindo.<br />1 colher de sopa de molho de peixe (fish sauce).</p>', '', '', '', '<p>A receita &eacute; para 1 tigela pequena.</p>\n<ol>\n<li>No pil&atilde;o de pedra: pilar o alho, raiz do coentro at&eacute; virar pasta. Separe.</li>\n<li>Em uma panela (sauce pan) no fogo m&eacute;dio: adicione &oacute;leo vegetal.<br />&nbsp;Adicione a pasta do mortar, em seguida adicione a pasta de curry vermelho e massaman. Mexa bem at&eacute; desenvolver aroma.</li>\n<li>Adicione o leite de coco e temperando a gosto. Adicione o amendoim torrado e moido e o gergelim torrado e deixe no fogo at&eacute; levantar fervura.</li>\n<li>Ferver por 5 minutos, mantenha mexendo continuamente para previnir os amendoins de grudar no fundo.</li>\n<li>Remova do calor e deixe esfriar. passar para uma tigela e servir.</li>\n</ol>', 'Chef Kanjana', 'kanjana.costa@gmail.com');
